import React, {Component} from 'react'

export class Navbar extends Component {
    static defaultprops = {
        title: "Github Finder",
        icon: "fab fa-github"
    }
    render() {
        return (<nav className='navbar bg-primary'>
            <h1>
                <i className={
                    this.props.icon
                }/> {
                this.props.title
            }</h1>
        </nav>)
    }
}

export default Navbar
